import aleo_bold from './Aleo-Bold.otf'
import aleo_italic from './Aleo-Italic.otf'
import aleo_regular from './Aleo-Regular.otf'

export default {
  aleo: {
    normal: {
      uri: aleo_regular,
      name: 'Aleo_Regular',
    },
    italic: {
      uri: aleo_italic,
      name: 'Aleo_Italic',
    },
    bold: {
      uri: aleo_bold,
      name: 'Aleo-Bold',
    },
  },
}
